ansicon = {version = "*", markers = "platform_system == \"Windows\""}

[[package]]
name = "jmespath"
version = "0.10.0"
description = "JSON Matching Expressions"
category = "main"
optional = false
python-versions = ">=2.6, !=3.0.*, !=3.1.*, !=3.2.*"

[[package]]
name = "jsii"
version = "1.42.0"
description = "Python client for jsii runtime"
category = "main"
optional = false
python-versions = "~=3.6"

[package.dependencies]
attrs = ">=21.2,<22.0"
cattrs = {version = ">=1.8.0,<1.9.0", markers = "python_version >= \"3.7\""}
